import React from 'react';

export default function App() {
  const DisplayData=this.state.details.map(
    (info)=>{
        return(
            <tr>
                <td>{info.fullname}</td>
                <td>{info.mobile}</td>
                <td>{info.email}</td>
            </tr>
        )
    }
)

return(
    <div>
        <table class="table table-striped">
            <thead>
                <tr>
                <th>Sr.NO</th>
                <th>Name</th>
                <th>City</th>
                </tr>
            </thead>
            <tbody>


                {DisplayData}

            </tbody>
        </table>

    </div>
)
}
